    return (
      <>
        <h1>{x} {y} {z} </h1>
        <h1>This is Matching</h1>
      </>
    )
  }
};

const App = () => {
  return (
    <>
      <h1>: Welcome to <span style={{ color: "red" }}>Slot Machine</span></h1>

      <slotM />

    </>
  )
}

export default App
